import React from "react";

function SkillsBar(props) {
    return (
        <div className="w-1/2 relative">
            <img className="boat-icon" src="./boat.svg" alt="Boat Icon"></img>
            <progress className="skillsBar w-full river-progress" value="50" max="100"></progress>

        </div>
    )
}

export default SkillsBar;
